                <label>Titre</label>
                <input type="text" placeholder="Entrez votre nom"/>
                <label>Votre article</label>
                <textarea name="" cols="30" rows="10" placeholder="Votre article"></textarea>
                <input type="submit" value="Envoyer"/>
           </form>
        </>
    );
}
